script: |
  super -f text -I q7276.spq | sort > q7276.out

inputs:
  - name: q7276.spq
    data: |
      SELECT DISTINCT + + col0, 80 + - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - col0 NOT IN ( col0, + 94, - - ( - col0 ), + col2 - + 55 + col2 + + - col2 );
  - name: tab0

outputs:
  - name: q7276.out
    data: |
      15	-1
      87	59
      97	79
